// src/components/MapWithList.js
import React, { useState } from 'react';
import MapComponent from './MapComponent'; // Assuming you have a MapComponent that accepts items and activeItem as props
import { redIcon, defaultIcon } from '../utils/MapIcons';

const items = [
  // ... your items with their coordinates and details
];

const MapWithList = () => {
  const [activeItem, setActiveItem] = useState(null);

  return (
    <div className="flex flex-row">
      <div className="w-1/3">
      </div>
      <MapComponent items={items} activeItem={activeItem} />
    </div>
  );
};

export default MapWithList;
